import  {ViolationTypes} from '../../action_types'
export function showInfowindow(item){

    return{
        type:ViolationTypes.SHOW_INFOWINDOW_VIOLATION,
        payload:item
    }
}
export function clearInfowindow(){

    return{
        type:ViolationTypes.CLEAR_INFOWINDOW_VIOLATION,
    }
}
export function getSearchViolationRequest(){
    console.log(ViolationTypes);

    return{
        type:ViolationTypes.SEARCH_VIOLATION.GET_SEARCH_VIOLATION_REQUEST
    }
}
export function getSearchViolationSuccess(data){
    return{
        type:ViolationTypes.SEARCH_VIOLATION.GET_SEARCH_VIOLATION_SUCCESS,
        payload:data
    }
}
export function getSearchViolationFailure(err){
    return{
        type:ViolationTypes.SEARCH_VIOLATION.GET_SEARCH_VIOLATION_FAILURE,
        err
    }
}
